import React from 'react';

// Add Router to App.js:
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';



// Import for Footer and Header Components:

//import Footer from './componenets/phases/footer';
import Footer from './components/phases/footer';
import Header from './components/phases/header';
import Home from ''
import Cart from './componenets/home/Cart';


// App:

const App = () => {
    return (
        <Router>
            <>
                <Header logo='https://www.shutterstock.com/image-vector/store-awning-canopy-red-color-600w-1548787097.jpg' />

                <div className='flex-wrapper'>
                    <Routes>
                        <Route path='/' element={<Home />} />
                        <Route path='/cart' element={<Cart />} />
                        <Route path='*' element={<h1>Page Not Found</h1>} />
                    </Routes>


                    <Footer text='Shop' />
                </div>
            </>
        </Router>
    );
}

export default App;
